import React, { useContext} from 'react'
import Pacientes from '../Pacientes/Pacientes'
import contexto from '../../context/Contexto'

function Questions() {
    const { pregunta } = useContext(contexto)

    const preguntas = pregunta.filter((pregunta)=> {
        return pregunta.tipo === "Pacientes"
    })
    
    return (
        <div>
            <h1>Preguntas:</h1>
            <div>
                {preguntas.map((preguntas) => (
                    <Pacientes key={preguntas.id}
                        pregunta={preguntas} />
                ))}
            </div>
        </div>
    )
}

export default Questions
